patchNotes.quote:
Season 2022 is in bloom!

We've carefully plucked a delicate bouquet for you this patch, including several champion nerfs and a significant update to the fighter item system. This is also our first patch reacting to Pro play on the preseason meta, so there's a lot of focus on balancing that skill bracket this week. Ahri's champion refresh is another part of the floral mix and, last but not leaf, the rest of the Crystal Rose and Withered Rose skins will be available soon. &#10048;

Allergies acting up with all this flowery language? Head on over to the pollen-free TFT patch notes here!
